INSERT INTO `review` VALUES (38,'Good foundation course','This course provided a solid foundation for mathematics. The professor was patient and took time to explain difficult concepts. The homework was manageable and helped reinforce learning.','MATHS 102',0,0,0,'2025-04-16 09:35:00',5,2,4,3,4,NULL),(39,'Helpful but challenging','General Mathematics was more difficult than I expected. The professor moves quickly through material, so you need to stay on top of things. Office hours were extremely helpful for clarifying concepts.','MATHS 108',0,0,0,'2025-04-17 13:20:00',12,4,2,3,4,NULL),(40,'Algebra made clear','The professor has a gift for making abstract concepts understandable. The course was well-structured with plenty of practice problems. Tutorials were particularly useful for working through challenging examples.','MATHS 120',0,0,0,'2025-04-18 11:15:00',8,3,3,4,5,NULL),(41,'Calculus is fascinating','This course opened my eyes to the beauty of calculus. The professor was passionate and engaging. Homework was challenging but well-designed to help understand the material deeply.','MATHS 130',1,0,0,'2025-04-16 14:40:00',22,4,3,5,5,NULL),(42,'Practical math applications','Computational Mathematics connected theory to real-world applications effectively. The programming components were particularly useful. Some assignments were unclear, but overall a valuable course.','MATHS 162',0,0,0,'2025-04-17 10:30:00',15,3,3,4,4,0000000001),(44,'Calculus is fascinating','This course opened my eyes to the beauty of calculus. The professor was passionate and engaging. Homework was challenging but well-designed to help understand the material deeply.','MATHS 130',4,0,0,'2025-04-16 14:40:00',22,4,3,5,5,NULL),(45,'Algebra made clear','The professor has a gift for making abstract concepts understandable. The course was well-structured with plenty of practice problems. Tutorials were particularly useful for working through challenging examples.','MATHS 120',0,0,0,'2025-04-18 11:15:00'