,(55,'Challenging but rewarding','This course pushed my mathematical understanding to new levels. The workload was heavy, but concepts built on each other logically. The professor was demanding but fair with grading.','MATHS 250',2,0,0,'2025-04-16 11:50:00',3,5,2,3,4,NULL),(56,'Essential for engineers','Differential Equations is a must-take course for anyone in engineering. The applications were relevant and interesting. The professor made a potentially dry subject engaging with real-world examples.','MATHS 260',0,0,0,'2025-04-17 09:15:00',19,4,2,4,5,NULL),(57,'Education focus helpful','As someone interested in teaching math, this course was invaluable. It provided practical strategies for explaining mathematical concepts. The group projects were particularly insightful.','MATHS 302',0,0,0,'2025-04-18 13:40:00',11,2,4,4,5,0000000001),(58,'Rigorous but necessary','Real Analysis is not for the faint-hearted. The proofs require careful thinking and precision. The professor was demanding but available to help during office hours. Essential for pure math students.','MATHS 332',4,0,0,'2025-04-17 14:35:00',7,5,1,2,4,NULL),(59,'Beautiful connections','This course elegantly connects real and complex analysis. The professor has a gift for making difficult concepts clear. The assignments were challenging but designed to deepen understanding rather than just test memorization.','MATHS 340',2,0,0,'2025-04-18 10:05:00',14,4,3,4,5,0000000001),(60,'Great intro to coding','Perfect course for beginners. The professor was patient and provided clear examples. Weekly labs reinforced lecture material effectively. Assignments were challenging but not overwhelming.','COMPSCI 101',0,0,0,'2025-04-16 13:25:00',2,2,4,4,5,NULL),(61,'Solid foundation','Introduction to Computer Systems provided essential knowledge for all CS students. The professor explained complex concepts clearly. Labs were sometimes frustrating but ultimately rewarding.','COMPSCI 110',0,0,0,'2025-04-17 11:40:00',18,3,3,3,4,00