evant.','DANCE 212',0,0,0,'2025-04-18 09:15:00',26,2,4,4,4,NULL),(144,'Culmination of skills','This advanced course requires everything you\'ve learned so far and pushes you even further. The performance opportunities were invaluable real-world experience. Be prepared for intense rehearsal schedules as the semester progresses.','DANCE 310',0,0,0,'2025-04-16 11:30:00',32,5,2,4,5,NULL),(145,'Practical production skills','Learning the behind-the-scenes aspects of dance performance was eye-opening. The lighting design and stage management components were particularly useful. The final production was stressful but incredibly rewarding and looked great on my portfolio.','DANCE 312',0,0,0,'2025-04-17 15:55:00',19,3,3,4,5,NULL),(146,'Cutting edge content','This course explores the fascinating intersection of technology and movement. The motion capture lab sessions were a highlight and unlike anything else in the program. Some technical difficulties occasionally disrupted classes, but the content was worth it.','DANCE 314',0,0,0,'2025-04-15 16:40:00',28,4,3,5,4,NULL),(147,'Creative freedom','This course allowed me to develop my own choreographic voice. The structured exercises gradually built up to creating our own complete works. The feedback sessions were sometimes harsh but always constructive and improved my work significantly.','DANCE 315',0,0,0,'2025-04-18 14:10:00',37,4,2,5,5,NULL),(148,'Challenging but fundamental','This course provides essential knowledge about organ systems for anyone pursuing biomedical sciences. The workload is heavy, with detailed diagrams and processes to memorize. The practical sessions were helpful in connecting theory to real human anatomy.','MEDSCI 142',0,0,0,'2025-04-16 10:15:00',44,4,2,3,5,NULL),(149,'Dense material, excellent teaching','The amount of information in this course is overwhelming at times, but the professor breaks it down effectively. The 3D anatomy models were crucial for understanding spatial relationships. Regular study groups were essential for keeping up with the material.','MEDSCI 201',0,0,0,'2025-04-17 09:30:00',22,5,2,3,4,NULL),(150,'Fascinating subject matter','The microbiology lab work was engaging and well-structured. The immunology section was particularly well-taught with clear explanations of complex mechanisms. The case studies helped connect theoretical knowledge to clinical applications.','MEDSCI 202',0,0,0,'2025-04-15 13:20:00',31,4,3,4,5,NULL),(151,'Important but poorly organized','While the content is crucial for understanding disease, the course structure was confusing. Different lecturers had inconsistent expectations and teaching styles. The pathology specimens were interesting but needed better explanation.','MEDSCI 203',0,0,0,'2025-04-18 16:25:00',9,4,2,2,2,NULL),(152,'Directly applicable knowledge','The pharmacological principles taught in this course are immediately relevant to clinical practice. The toxicology section was particularly well-taught with interesting case studies. The medication calculation exercises were practical and important.','MEDSCI 204',0,0,0,'2025-04-16 11:40:00',27,3,3,3,4,NULL),(153,'Clear explanations of complex systems','The professor has a gift for making complicated physiological processes understandable. The laboratory sessions reinforced lecture content effectively. I appreciated the clinical correlations that showed why each system is important in medicine.','MEDSCI 205',0,0,0,'2025-04-17 14:50:00',35,3,3,4,5,NULL),(154,'Fascinating but challenging','Neuroscience is one of the most interesting subjects I\'ve studied, but also one of the most difficult. The neural pathway mapping exercises were particularly challenging. The brain specimens and models were invaluable for understanding neuroanatomy.','MEDSCI 206',0,0,0,'2025-04-15 12:30:00',41,5,2,4,4,NULL),(155,'Cutting-edge content','This course brings together molecular biology and pathology in a way that illuminates disease mechanisms. The genetic testing simulation labs were particularly valuable. Stay on top of the readings as the lectures move quickly through complex material.','MEDSCI 301',0,0,0,'2025-04-18 10:45:00',29,4,2,3,5,NULL),(156,'Thorough and thoughtful','The professor clearly cares deeply about cancer research and it shows in the quality of teaching. The molecular pathways were explained with clarity and context. The journal club discussions of recent research papers were enlightening.','MEDSCI 302',0,0,0,'2025-04-16 15:35:00',38,4,3,4,5,NULL),(157,'Detailed and practical','This course delves deep into cardiovascular physiology and pathology. The ECG interpretation sessions were particularly useful for clinical applications. The case-based learning approach helped connect theory to patient presentations.','MEDSCI 311',0,0,0,'2025-04-17 12:15:00',25,4,2,3,4,NULL),(158,'Excellent lab work','The immunology laboratory sessions were exceptional, with well-designed experiments that reinforced lecture content. The professor explains complex immune mechanisms clearly. The clinical correlation sections helped understand why immunology matters in medicine.','MEDSCI 314',0,0,0,'2025-04-15 11:25:00',33,3,3,4,5,NULL),(159,'Relevant and engaging','This course bridges nutrition science and genetics in a way that feels highly relevant to modern medicine. The dietary analysis project was practical and illuminating. The professor incorporates the latest research which makes the course feel current.','MEDSCI 315',0,0,0,'2025-04-18 13:40:00',6,3,3,4,4,NULL),(160,'Perfect introduction','This course provides an excellent foundation for understanding sociological concepts. The discussions were engaging and encouraged critical thinking. The reading load was manageable and the professor made complex theories accessible.','SOCIOL 100',0,0,0,'2025-04-16 14:30:00',31,2,4,4,5,NULL),(161,'Eye-opening perspective','This course gave me a new understanding of New Zealand society and its historical context. The field trips to significant cultural sites were valuable learning experiences. The guest speakers from different communities added important diverse perspectives.','SOCIOL 101',0,0,0,'2025-04-17 11:20:00',23,2,4,5,5,NULL),(162,'Practical policy focus','The course provides a thorough analysis of social policy development in New Zealand. The case studies of recent policy changes were particularly informative. I appreciated the emphasis on social justice frameworks and their practical applications.','SOCIOL 103',0,0,0,'2025-04-15 15:45:00',39,3,3,3,4,NULL),(163,'Dense but rewarding','The theoretical frameworks covered in this course are challenging but essential for advanced sociology study. The professor does a good job of connecting abstract theories to concrete examples. The weekly discussion sections helped clarify difficult concepts.','SOCIOL 200',0,0,0,'2025-04-18 09:55:00',27,4,2,3,4,NULL),(164,'Highly relevant course','This course examines gender and family dynamics through a sociological lens that feels immediately relevant to everyday life. The documentary screenings sparked thoughtful discussions. The research project allowed me to explore a specific aspect that interested me.','SOCIOL 207',0,0,0,'2025-04-16 12:40:00',42,2,4,4,5,NULL),(165,'Challenging economic perspective','The course offers an important sociological perspective on economic systems that you won\'t get in economics classes. Some of the reading material was quite dense and theoretical. The professor could have provided more real-world examples to illustrate concepts.','SOCIOL 208',0,0,0,'2025-04-17 16:15:00',30,4,2,2,3,NULL),(166,'Thought-provoking content','This course challenged my understanding of global systems and social justice frameworks. The colonial history sections were particularly enlightening. The debates on decolonization strategies were some of the most engaging discussions I\'ve had in university.','SOCIOL 210',0,0,0,'2025-04-15 10:30:00',36,3,3,5,5,NULL),(167,'Essential perspectives','This course examines identity formation in a way that feels both academically rigorous and personally relevant. The ethnographic research assignment was challenging but rewarding. Guest speakers from different ethnic communities added valuable first-hand perspectives.','SOCIOL 213',0,0,0,'2025-04-18 15:10:00',21,3,3,4,5,NULL),(168,'Advanced theoretical work','Be prepared for dense readings and complex theoretical frameworks. The professor expects a high level of critical engagement with primary texts. While challenging, the course provides valuable tools for analyzing capitalist systems from multiple perspectives.','SOCIOL 301',0,0,0,'2025-04-16 09:20:00',1,5,1,3,4,NULL),(169,'Unique regional focus','This course offers insights into Pacific societies that are rarely covered in other classes. The transnational approach to understanding Pacific communities was illuminating. The guest lecturers from various Pacific nations added authentic perspectives to the academic content.','SOCIOL 307',0,0,0,'2025-04-17 13:35:00',34,3,3,4,5,NULL),(170,'Practical research skills','This course provides valuable hands-on experience with social research methods. The project-based approach allowed me to investigate a social issue I care about. The statistics sections were challenging but essential for data analysis.','SOCIOL 310',0,0,0,'2025-04-15 14:50:00',40,4,2,3,4,NULL),(171,'Interdisciplinary excellence','The course bridges sociology and public health in an illuminating way. The case studies of healthcare disparities were particularly powerful. I appreciated the emphasis on both social determinants of health and lived experiences of illness.','SOCIOL 333',0,0,0,'2025-04-18 11:55:00',25,3,3,4,5,NULL),(172,'Fascinating overview','This general education course provides an accessible introduction to how law shapes society. The case studies were engaging and prompted thoughtful discussions. Even as a non-law student, I found the material relevant to my understanding of social systems.','LAW 121G',0,0,0,'2025-04-16 15:25:00',20,2,4,5,5,NULL),(173,'Essential foundation','Legal Method provides the fundamental skills needed for law school success. The legal research exercises were practical and well-designed. The writing assignments helped develop the precise analytical style needed for legal documents.','LAW 131',0,0,0,'2025-04-17 10:15:00',32,3,3,2,5,NULL),(174,'Solid introduction','This course covers essential legal concepts and principles that form the foundation of legal studies. The tutorials were helpful for working through complex ideas. The professor uses clear examples that make abstract legal concepts more concrete.','LAW 141',0,0,0,'2025-04-15 11:45:00',3,3,3,3,4,NULL),(175,'Challenging but fascinating','Criminal law covers complex legal principles and significant case law. The moot court exercise was particularly valuable for understanding procedural aspects. The professor has high expectations but provides the support needed to meet them.','LAW 201A',0,0,0,'2025-04-18 14:30:00',28,4,2,4,5,NULL),(176,'Important constitutional concepts','Public Law explores the fundamental structures of government and constitutional principles. The comparative analysis of different constitutional systems was particularly enlightening. The professor clearly explains complex constitutional doctrines and their practical implications.','LAW 211A',0,0,0,'2025-04-16 13:10:00',37,4,2,3,4,NULL),(177,'Case-heavy course','Be prepared to read and analyze numerous tort cases throughout the semester. The problem-solving exercises were excellent practice for exam scenarios. The professor is demanding but fair in assessment and provides detailed feedback.','LAW 231A',0,0,0,'2025-04-17 15:40:00',26,5,2,3,4,NULL),(178,'Fundamental legal knowledge','Contract law is essential for any legal career and this course provides comprehensive coverage. The contract drafting exercises were particularly valuable practical experience. The professor effectively balances theoretical principles with practical applications.','LAW 241A',0,0,0,'2025-04-15 16:55:00',5,4,2,3,5,NULL),(179,'Complex but important','Land Law covers intricate legal principles governing property rights. The historical development of property law concepts helps understand current practices. The professor\'s expertise in the subject is evident in the detailed and nuanced lectures.','LAW 301A',0,0,0,'2025-04-18 12:20:00',33,5,1,2,4,NULL),(180,'Conceptually challenging','Equity requires a shift in legal thinking that can be difficult to grasp initially. The case analysis assignments were effective in developing understanding of equitable principles. The tutorial discussions were essential for working through complex concepts.','LAW 306A',0,0,0,'2025-04-16 10:50:00',29,5,1,3,4,NULL),(181,'Philosophical depth','Jurisprudence explores the theoretical foundations of law in a way that challenges conventional thinking. The reading load is heavy but rewarding for those interested in legal philosophy. Class discussions were intellectually stimulating and well-facilitated by the professor.','LAW 316',0,0,0,'2025-04-17 09:05:00',7,4,2,4,5,NULL),(182,'Practical and necessary','This course addresses the ethical dimensions of legal practice with relevant examples. The ethical dilemma scenarios were thought-provoking and realistic. The guest speakers from different areas of legal practice provided valuable insights from the field.','LAW 398',0,0,0,'2025-04-15 13:15:00',24,2,4,3,5,NULL),(183,'Valuable skills development','The course builds on basic research skills to develop advanced legal research capabilities. The database training sessions were particularly useful for professional practice. The research project allowed me to explore an area of law I\'m interested in pursuing further.','LAW 399',0,0,0,'2025-04-18 16:05:00',30,3,3,2,4,NULL),(184,'Nazi Germany analysis','Nazi Germany and its Legacies examines a difficult historical period with appropriate gravity. The professor balanced factual detail with ethical considerations. Readings were extensive but essential.','HISTORY 217',0,0,0,'2025-04-17 11:05:00',29,4,2,3,5,NULL),(185,'Waste of time and tuition money','LAW 121G was supposed to provide insight into the relationship between law and society, but instead was a disorganized mess of concepts. The lecturer seemed unprepared for most classes and often went off on tangents unrelated to the course material. The readings were excessive and rarely discussed in any meaningful way during lectures.\n    \n    Group assignments were particularly frustrating as evaluation was not fairly distributed among team members. One person would do all the work while others got the same grade for minimal contribution. The exam focused on memorization rather than understanding legal concepts in societal contexts.\n    \n    I would strongly advise taking a different general education course if you want to actually learn something useful.','LAW 121G',0,0,0,'2025-04-16 10:20:00',12,2,1,1,1,NULL),(187,'Unexpectedly challenging','I selected PHIL 105G thinking it would be an easy GenEd credit, but was surprised by how demanding the course actually was. The philosophical concepts were presented at a level that assumed prior knowledge many students didn\'t have.\n    \n    The lecturer spoke too quickly and used jargon without proper explanation. Weekly readings were dense and typically 40+ pages, which is excessive for an introductory course. Tutorial discussions were dominated by a few philosophy majors while the rest of us struggled to keep up.\n    \n    Assessment tasks required a level of philosophical analysis that wasn\'t adequately taught in the course. Would not recommend unless you already have some background in philosophy or are prepared to put in significant extra work.','PHIL 105G',0,0,0,'2025-04-15 09:45:00',37,4,1,2,2,NULL),(188,'Basic content, boring delivery','SCIGEN 101G was one of the most mind-numbing experiences of my university career. The course attempted to provide a general overview of scientific principles but managed to strip away anything interesting in the process.\n    \n    Lectures consisted of the professor reading directly from slides packed with text. Labs were formulaic and failed to inspire any curiosity about scientific inquiry. The assignments were straightforward but tedious, focusing on regurgitation rather than understanding.\n    \n    While the course was an easy grade, I learned very little that wasn\'t already covered in high school science. The only positive aspect was that minimal effort was required to pass. There are much better GenEd options available.','SCIGEN 101G',0,0,0,'2025-04-18 11:10:00',19,1,4,1,2,NULL),(189,'Enlightening cultural experience','MĀORI 130G offered a profound introduction to Māori culture, history, and language that has genuinely enriched my understanding of New Zealand. The course was thoughtfully structured to accommodate students from all backgrounds, with no prior knowledge required.\n    \n    The lecturer integrated traditional knowledge with contemporary issues facing Māori communities today. Field trips to local marae provided invaluable experiential learning that couldn\'t be gained from textbooks alone. Guest speakers from various iwi offered diverse perspectives and personal insights.\n    \n    Assessment tasks were creative and allowed for personal reflection alongside academic analysis. This course has changed how I view New Zealand history and society. Easily one of the most valuable GenEd options available.','MĀORI 130G',0,0,0,'2025-04-16 13:25:00',41,2,3,5,5,NULL),(190,'Dry content, outdated teaching methods','ECON 151G attempts to teach basic economic principles but fails to make the material relevant or engaging. The lecturer relied entirely on decades-old PowerPoint slides that haven\'t been updated to reflect current economic realities or examples.\n    \n    Classes consisted of monotonous lectures with minimal student participation or discussion. The textbook was expensive and barely utilized. Tutorial sessions were slightly better but still focused on mechanical problem-solving rather than understanding economic concepts in real-world contexts.\n    \n    Assessments were primarily multiple-choice tests that rewarded memorization over critical thinking. The final exam was particularly brutal, covering material that was barely mentioned in lectures. This course needs a complete overhaul to be worth taking.','ECON 151G',0,0,0,'2025-04-17 16:50:00',28,3,2,1,1,NULL),(193,'Surprisingly enjoyable for a GenEd','MUS 144G introduced me to musical concepts and history in an accessible way that didn\'t require prior musical training. The lecturer\'s passion for the subject was evident, making even technical aspects of music theory engaging for beginners.\n    \n    Classes incorporated plenty of musical examples spanning different genres and time periods, which helped illustrate the concepts being taught. The course struck a good balance between historical context and practical appreciation of musical elements.\n    \n    Assessment tasks were creative and allowed students to explore their own musical interests. The concert review assignment was particularly enjoyable as it encouraged us to experience live music and apply what we\'d learned. Tutorial sessions reinforced lecture material through interactive listening exercises.\n    \n    Overall, this exceeded my expectations for a GenEd course and provided genuine enrichment beyond my main field of study.','MUS 144G',0,0,0,'2025-04-16 15:40:00',26,2,3,4,4,NULL),(194,'Mediocre course, mediocre experience','ASTRO 100G had the potential to be fascinating—after all, who doesn\'t find space interesting? Unfortunately, the course managed to make astronomy tedious through poor teaching methods and outdated resources.\n    \n    Lectures consisted primarily of the professor reading from slides dense with text and equations but light on explanation or context. Questions from students were often dismissed or inadequately addressed. The recommended textbook was expensive and barely referenced during the course.\n    \n    The one night observation session was a highlight, but was poorly organized with too many students for the available telescopes. Assessment tasks were straightforward but feedback was minimal and unhelpful for improvement.\n    \n    While not terrible, the course failed to inspire any real enthusiasm for astronomy. With better teaching and more interactive components, this could be a much better experience.','ASTRO 100G',0,0,0,'2025-04-17 12:30:00',44,3,2,2,2,NULL),(195,'Theoretical without practical application','EDUC 106 claims to provide foundational knowledge of education systems but fails to connect theory to practice in any meaningful way. The course was heavily weighted toward abstract philosophical concepts without demonstrating how these apply in actual educational settings.\n    \n    Readings were excessively academic and written in unnecessarily complex language that obfuscated rather than clarified key concepts. Lectures followed a similar pattern, with the professor seeming more interested in showcasing vocabulary than ensuring student understanding.\n    \n    Discussion sessions rarely allowed for exploration of diverse viewpoints, with certain perspectives clearly favored over others. Assessment tasks were vague with shifting expectations, making it difficult to know what was actually required.\n    \n    The complete absence of classroom observation or any practical component was a significant weakness for a course supposedly introducing students to education as a field.','EDUC 106',0,0,0,'2025-04-16 13:20:00',17,3,1,1,1,NULL),(197,'Valuable but imperfectly executed','EDCURRIC 220 addresses important subject matter regarding curriculum development and implementation. The content was generally relevant and useful for prospective teachers, particularly the sections on assessment design and differentiation strategies.\n    \n    However, the course suffered from organizational issues that diminished its effectiveness. Lecture topics often felt disconnected from one another, without a clear progression or framework. Required readings varied dramatically in quality and relevance, with some being outstanding while others seemed included merely to fill space.\n    \n    The practical assignments were the strongest component, allowing us to develop and critique actual curriculum materials. Unfortunately, feedback on these assignments was delayed and often too general to be helpful for improvement.\n    \n    With better organization and more consistent quality across all components, this could be an excellent course.','EDCURRIC 220',0,0,0,'2025-04-15 14:50:00',36,3,2,2,3,NULL),(198,'Superficial treatment of important topics','EDUC 121 attempted to cover diversity in educational settings but managed to do so in the most surface-level way possible. Complex issues of cultural, socioeconomic, and ability differences were reduced to simplistic generalizations and tokenistic examples.\n    \n    Class discussions rarely moved beyond basic acknowledgment of diversity to engage with the genuine challenges and systemic issues in education. The lecturer seemed uncomfortable facilitating discussions about controversial or sensitive topics, which limited meaningful dialogue.\n    \n    Assignments encouraged personal reflection but provided little guidance on connecting this reflection to scholarly literature or developing practical strategies for inclusive teaching. Feedback was overwhelmingly positive regardless of the quality of work submitted, suggesting a reluctance to challenge students\' thinking.\n    \n    For a course on such an important topic, the lack of depth and critical engagement was deeply disappointing.','EDUC 121',0,0,0,'2025-04-18 10:15:00',22,1,4,2,1,NULL),(199,'Excellent practical preparation','EDPRAC 204 stands out as one of the most valuable courses in the education program due to its focus on actual classroom practice. The structured progression from observation to assisted teaching to independent lessons was thoughtfully designed to build confidence and skills.\n    \n    The university supervisors were knowledgeable and provided specific, actionable feedback after each observation. Weekly seminars effectively connected classroom experiences to theoretical concepts from other courses, helping integrate different aspects of teacher education.\n    \n    Assignment requirements were clear and directly relevant to developing professional practice. The reflective journal in particular encouraged meaningful analysis of teaching experiences rather than superficial descriptions.\n    \n    The associate teachers at placement schools were generally well-prepared for their mentoring role, though quality varied somewhat between placements. Overall, this course provided essential practical experience that no theoretical course could replace.','EDPRAC 204',0,0,0,'2025-04-16 11:30:00',40,4,2,4,5,NULL),(200,'Disconnected from teaching reality','EDPROFST 303 purports to prepare students for professional teaching practice, but the content seemed developed by academics with minimal recent classroom experience. The course emphasized theoretical frameworks while giving scant attention to the practical challenges new teachers actually face.\n    \n    Lectures presented idealized versions of teaching that bore little resemblance to current school environments. When students raised questions about real-world applications or limitations, these were often dismissed as \"defeatist thinking\" rather than engaged with constructively.\n    \n    The assessment tasks required excessive documentation and academic writing that would never be required in actual teaching practice. The disconnect between course requirements and professional reality was striking and frustrating.\n    \n    Guest speakers from schools occasionally provided valuable insights, but these were too infrequent to offset the overall theoretical bias of the course. A significant redesign with input from current practitioners is needed.','EDPROFST 303',0,0,0,'2025-04-17 15:20:00',31,3,1,1,2,NULL),(202,'Complete waste of a semester','EDUC 352 stands as a monument to everything wrong with teacher education. The course recycled content from earlier papers with minimal additional depth or complexity, essentially making students pay again for knowledge they already possessed. Lectures were disorganized rambles that rarely connected to the stated topic or learning objectives. The lecturer frequently canceled classes with minimal notice or arrived unprepared, wasting valuable time with irrelevant anecdotes rather than substantive content. Assignments seemed designed to generate marking work rather than develop useful professional skills. Feedback was sparse and unhelpful, often consisting of a few generic comments that could apply to any submission. The complete lack of responsiveness to student concerns about course quality was perhaps the most frustrating aspect. Multiple class representatives raised issues throughout the semester with no resulting improvements. This course needs to be completely redesigned or removed from the program.','EDUC 352',0,0,0,'2025-04-18 14:05:00',13,1,4,0,0,NULL),(204,'Unnecessarily complicated and theoretical','EDCURRM 201 turned what should have been practical curriculum planning into an exercise in academic verbosity and theoretical complexity. The course was overwhelming in its use of specialized terminology and convoluted frameworks that added little value to the fundamental task of designing effective learning experiences.\n    \n    Lectures consisted of dense presentations packed with models and acronyms that seemed designed to make simple concepts appear sophisticated rather than to enhance understanding. When students requested concrete examples or clarification, responses often added further layers of abstraction instead of clarity.\n    \n    Assignments required excessive documentation and justification for basic instructional decisions, creating artificial complexity that would be impossible to maintain in actual teaching practice. Feedback focused on theoretical alignment rather than practical effectiveness or student engagement.\n    \n    The few practical components were the only valuable aspects of the course. Otherwise, it represented the worst tendencies of academic education programs—disconnected from classroom reality and needlessly complicated.','EDCURRM 201',0,0,0,'2025-04-17 11:25:00',21,4,1,1,1,NULL),(205,'Unnecessarily complicated and theoretical','EDCURRM 201 turned what should have been practical curriculum planning into an exercise in academic verbosity and theoretical complexity. The course was overwhelming in its use of specialized terminology and convoluted frameworks that added little value to the fundamental task of designing effective learning experiences.\n    \n    Lectures consisted of dense presentations packed with models and acronyms that seemed designed to make simple concepts appear sophisticated rather than to enhance understanding. When students requested concrete examples or clarification, responses often added further layers of abstraction instead of clarity.\n    \n    Assignments required excessive documentation and justification for basic instructional decisions, creating artificial complexity that would be impossible to maintain in actual teaching practice. Feedback focused on theoretical alignment rather than practical effectiveness or student engagement.\n    \n    The few practical components were the only valuable aspects of the course. Otherwise, it represented the worst tendencies of academic education programs—disconnected from classroom reality and needlessly complicated.','EDCURRM 201',0,0,0,'2025-04-17 11:25:00',21,4,1,1,1,NULL),(206,'Comprehensive overview','The historical context provided in this course was fascinating and helped me appreciate dance on a deeper level. The readings were sometimes dry but the in-class discussions made the material come alive. The performance analysis assignments were particularly valuable.','DANCE 107',0,0,0,'2025-04-17 10:45:00',24,2,4,3,4,NULL),(207,'Waste of time and tuition money','LAW 121G was supposed to provide insight into the relationship between law and society, but instead was a disorganized mess of concepts. The lecturer seemed unprepared for most classes and often went off on tangents unrelated to the course material. The readings were excessive and rarely discussed in any meaningful way during lectures.\n    \n    Group assignments were particularly frustrating as evaluation was not fairly distributed among team members. One person would do all the work while others got the same grade for minimal contribution. The exam focused on memorization rather than understanding legal concepts in societal contexts.\n    \n    I would strongly advise taking a different general education course if you want to actually learn something useful.','LAW 121G',0,0,0,'2025-04-16 10:20:00',12,2,1,1,1,NULL),(208,'Waste of time and tuition money','LAW 121G was supposed to provide insight into the relationship between law and society, but instead was a disorganized mess of concepts. The lecturer seemed unprepared for most classes and often went off on tangents unrelated to the course material. The readings were excessive and rarely discussed in any meaningful way during lectures.\n    \n    Group assignments were particularly frustrating as evaluation was not fairly distributed among team members. One person would do all the work while others got the same grade for minimal contribution. The exam focused on memorization rather than understanding legal concepts in societal contexts.\n    \n    I would strongly advise taking a different general education course if you want to actually learn something useful.','LAW 121G',0,0,0,'2025-04-16 10:20:00',12,2,1,1,1,NULL);
